CREATE DATABASE  IF NOT EXISTS `schools`;
USE `schools`;

create table schools (
	school_name VARCHAR(15),
	address VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	postal_code VARCHAR(50),
	phone_number VARCHAR(50),
	principal_name VARCHAR(50),
	student_count INT,
	established_date DATE,
	website VARCHAR(1000)
);
